        [TestMethod]
        [TestCategory("UnitTestApp")]
        public void Serialize_and_deserialize_FeatureCollection()
        {           
            Polygon polygon1 = CreateTestPolygon1();
            Polygon polygon2 = CreateTestPolygon2();
            var feature1 = new Feature(polygon1);
            var feature2 = new Feature(polygon2);
            var features = new List<Feature> {feature1, feature2};
            var featureCollection = new FeatureCollection(features);


            var serializerSettings = new JsonSerializerSettings { ContractResolver = new CustomPropertySortContractResolver() };
            //var serializerSettings = new JsonSerializerSettings(); 
            string geojson = JsonConvert.SerializeObject(featureCollection, serializerSettings);

            FeatureCollection deSerializedFeatureCollection = JsonConvert.DeserializeObject(geojson, typeof(FeatureCollection)) as FeatureCollection;
            Assert.IsTrue(featureCollection != null, "GeoJSON deserialization of FeatureCollection failed.");
            

            // Test polygon 1

            Feature deSerializedFeature1 = deSerializedFeatureCollection.Features[0];            
            Assert.IsTrue(deSerializedFeature1.Type == GeoJSONObjectType.Feature);
            Polygon deSerializedPolygon1 = (Polygon)deSerializedFeature1.Geometry;            
            Assert.IsTrue(deSerializedPolygon1.Type == GeoJSONObjectType.Polygon);
            
            
            GeographicPosition deSerializedPolygon1Pos1 = (GeographicPosition) deSerializedPolygon1.Coordinates[0].Coordinates[0];
            GeographicPosition deSerializedPolygon1Pos2 = (GeographicPosition) deSerializedPolygon1.Coordinates[0].Coordinates[1];
            GeographicPosition deSerializedPolygon1Pos3 = (GeographicPosition) deSerializedPolygon1.Coordinates[0].Coordinates[2];
            GeographicPosition deSerializedPolygon1Pos4 = (GeographicPosition) deSerializedPolygon1.Coordinates[0].Coordinates[3];
            
            GeographicPosition serializedPolygon1Pos1 = (GeographicPosition) polygon1.Coordinates[0].Coordinates[0];
            GeographicPosition serializedPolygon1Pos2 = (GeographicPosition) polygon1.Coordinates[0].Coordinates[1];
            GeographicPosition serializedPolygon1Pos3 = (GeographicPosition) polygon1.Coordinates[0].Coordinates[2];
            GeographicPosition serializedPolygon1Pos4 = (GeographicPosition) polygon1.Coordinates[0].Coordinates[3];
            
            Assert.IsTrue(Math.Abs(deSerializedPolygon1Pos1.Longitude - serializedPolygon1Pos1.Longitude) < 0.001);
            Assert.IsTrue(Math.Abs(deSerializedPolygon1Pos2.Longitude - serializedPolygon1Pos2.Longitude) < 0.001);
            Assert.IsTrue(Math.Abs(deSerializedPolygon1Pos3.Longitude - serializedPolygon1Pos3.Longitude) < 0.001);
            Assert.IsTrue(Math.Abs(deSerializedPolygon1Pos4.Longitude - serializedPolygon1Pos4.Longitude) < 0.001);
            Assert.IsTrue(Math.Abs(deSerializedPolygon1Pos1.Latitude - serializedPolygon1Pos1.Latitude) < 0.001);
            Assert.IsTrue(Math.Abs(deSerializedPolygon1Pos2.Latitude - serializedPolygon1Pos2.Latitude) < 0.001);
            Assert.IsTrue(Math.Abs(deSerializedPolygon1Pos3.Latitude - serializedPolygon1Pos3.Latitude) < 0.001);
            Assert.IsTrue(Math.Abs(deSerializedPolygon1Pos4.Latitude - serializedPolygon1Pos4.Latitude) < 0.001);



            // Test polygon 2
            Feature deSerializedFeature2 = deSerializedFeatureCollection.Features[1];
            Assert.IsTrue(deSerializedFeature2.Type == GeoJSONObjectType.Feature);
            Polygon deSerializedPolygon2 = (Polygon)deSerializedFeature2.Geometry;
            Assert.IsTrue(deSerializedPolygon2.Type == GeoJSONObjectType.Polygon);

        }


